import React from 'react';

const Course = (props) => {
    return (
        <div>
            <div className="ui divider"></div>
            <h2></h2>
            <div className="ui divider"></div>
            <img className="ui fluid image" src="/idapro.jpg" />
            <br />
            <p>Understood in detail some complex concepts such as x86 assembly language, static analysis of code, and dynamic debugging.</p>
            <br />
        </div>
    );
};

export default Course;
